import Link from 'next/link'
import Layout from '../components/Layout'

export default () => (
    <Layout title={'Index'}>
        <div className='container'>
            <div className='nav'>INDEX PAGES</div>
        </div>

        <style jsx Global>
            {`
                .container{
                    width:100%;
                    height:90px;
                }
               
            `}
        </style>
    </Layout>
)
